var particles=[];
var timeLine=[];
for(var i=0;i<100;i++){
  timeLine.push([]);
}
for(var region=0;region<stats.length;region++){
  particles.push([]);
  let day=0;
  var last=0;
  var lastRecovered=0;
  var lastDied=0;
  for(var key in stats[region]){
    if(key.indexOf("/20")>0){
      if(day>0){
        for(var i=stats[region][key]-last;i>0;i--){
          timeLine[day].push([[0,region],Math.random()]);
        }
        for(var i=recover[region][key]-lastRecovered;i>0;i--){
          timeLine[day].push([[1,region],Math.random()]);
        }
        for(var i=died[region][key]-lastDied;i>0;i--){
          timeLine[day].push([[2,region],Math.random()]);
        }
      }
      last=stats[region][key];
      lastRecovered=recover[region][key];
      lastDied=died[region][key];
      day++;
    }
  }
}
while(timeLine[timeLine.length-1].length===0){timeLine.pop();}

for(let day=0;day<timeLine.length;day++){
  timeLine[day]=timeLine[day].sort((a,b)=> a[1]-b[1]);
  timeLine[day]=timeLine[day].map(x => x[0]);
}

var worldMap;

function setup() {
  can=createCanvas(windowWidth, windowHeight);
  frameRate(10);

  angleMode(DEGREES);

  worldMap=loadImage("World_map.svg");
}
/*
var eqar=function(lon,lat){
    return [300+lon/180*(cos(lat))*295,200-lat*300/180];
};*/
function eqar(lon,lat,w,h){
    //return [w/2+lon/180*cos(lat)*w/2,h/2-lat*h/2/180];
    return [w/2+lon/180*cos(lat)*w/2,h/2-lat*h/180];
};

var onDay=1;
var t=0;


var st=0;
//draw
function draw() {
  frameRate(5);
  background(0);
  image(worldMap,0,height/2-width/4,width,width/2);
  if(st<50){st++;return;}

  noStroke();

  fill(255);
  textSize(30);
  textAlign(CENTER,TOP);

  var dateTime=new Date(new Date("1/22/20").getTime()+1000*60*60*24*(onDay+t/timeLine[onDay].length));

  text(dateTime.toLocaleString().replace(', ','\n'),width/2,5);
  textAlign(CENTER,BOTTOM);
  textSize(15);
  text("Data from https://github.com/CSSEGISandData/COVID-19\n2020 Edward Haas",width/2,height-5);

  fill(255,0,0);

  for(var i=timeLine[onDay].length/60;i>0;i--){
    var onRegion=timeLine[onDay][t][1];
    switch(timeLine[onDay][t][0]){
      case(1):
        var id=0;
        while(id<particles[onRegion].length&&particles[onRegion][id][3]!=0){id++;}
        if(id>=particles[onRegion].length){break;}
        particles[onRegion].push(
          [particles[onRegion][id][0],particles[onRegion][id][1],255,1]);
        particles[onRegion].splice(id,1);
        break;
      case(2):
        var id=0;
        while(id<particles[onRegion].length&&particles[onRegion][id][3]!=0){id++;}
        if(id>=particles[onRegion].length){break;}
        particles[onRegion].push(
          [particles[onRegion][id][0],particles[onRegion][id][1],255,2]);
        particles[onRegion].splice(id,1);
        break;
      default:
      var theta=Math.random()*360;
      var r=Math.random()/(0.5+Math.random())*3;
      var cnt=0;
      var cords=cords=eqar(stats[onRegion].Long+cos(theta)*r,stats[onRegion].Lat+sin(theta)*r,worldMap.width,worldMap.height);
      while(cnt++<20&&worldMap.get(cords[0]>>0,cords[1]>>0)[0]==30){
        theta=Math.random()*360;
        r=Math.random()/(0.5+Math.random())*3;
        cords=eqar(stats[onRegion].Long+cos(theta)*r,stats[onRegion].Lat+sin(theta)*r,worldMap.width,worldMap.height);
      }
      var cords=eqar(stats[onRegion].Long+cos(theta)*r,stats[onRegion].Lat+sin(theta)*r,width,width/2);

      particles[onRegion].push([cords[0],cords[1]+height/2-width/4,255,0]);
    }

    t++;
    if(t>=timeLine[onDay].length){
      t=0;
      onDay++;
      if(onDay>=timeLine.length){
        onDay=1;
        //noLoop();
      }
    }
  }


  for(var i=0;i<particles.length;i++){
    for(var j=0;j<particles[i].length;j++){
      switch(particles[i][j][3]){
        case(1):
        fill(0,255,0,particles[i][j][2]);
        rect(particles[i][j][0]-1,particles[i][j][1]-1,3,3);
        break;
        case(2):
        fill(255,0,0,particles[i][j][2]);
        rect(particles[i][j][0]-1,particles[i][j][1]-1,3,3);
        break;
        default:
        fill(128,128,255,particles[i][j][2]/2);
        rect(particles[i][j][0]-1,particles[i][j][1]-1,2,2);
      }
      if(particles[i][j][3]>0||particles[i][j][2]>50){
        particles[i][j][2]-=5;
      }
      if(particles[i][j][2]<=0){
        particles[i].splice(j,1);
        j--;
      }
    }
  }

}

function windowResized() {
  resizeCanvas(windowWidth, windowHeight);
}
